import React from 'react';
import '../../css/myPage/myPage_chat.css';
import chatIcon from '../../assets/chat-icon.png'; // 아이콘 경로는 네 프로젝트에 맞게 조정

function MyPageChat() {
  return (
    <div className="chat-box"> {/* ✅ 하나만 */}
      <img src={chatIcon} alt="chat" className="chat-icon" />
      <div className="chat-text">
        <div className="chat-title">'자라나는 새싹'님과 채팅하기</div>
        <div className="chat-desc">상품에 대한 자세한 정보를 알고싶다면?</div>
      </div>
      <button className="chat-button">채팅하기</button>
    </div>
  );
}

export default MyPageChat;
